import register from '../register';
import {getParams} from '../utils';
import {open} from './index';

register('easybrowse/openImageUrlAddress', {
    v: 50,
    hasCB: true,
    versionRange: ['11.13'],
    supportFrame: ['h5', 'hybird'],
    filter() {
        return {
            module: 'easybrowse',
            action: 'imageUrlAddress'
        };
    }
});
/**
 * @function openImageUrlAddress
 * @param {Object} [params={}] - 参数
 */
export default (params = {}) => open(getParams('easybrowse-imageUrlAddress', params));
